import React from "react"
import "./home.css"

const Home = () => {
  const Button = styled.button`
  background-color: black;
  color: white;
  font-size: 20px;
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

  return (
    <>
      <section className='hero'>
        <h1>Welcome Arya to TOPY Station</h1>
        <Button>Set up a meeting</Button>
        <Button>Meeting Request</Button>

      </section>
    </>
  )
}
export default Home
